import './mainTopicsStyles.css';
import React from "react";
import { mainTopic } from "../Details/Details";


function MainTopic () {

    return (
        <section id="main-principal">
            <h1 className="title">Articulos Destacados</h1>
            <div id="principal-grid">
                {mainTopicGenerate}
            </div>
        </section>
    );
}
export default MainTopic;
